ll gcd(ll a, ll b) {
	if (b == 0) return a;
	return gcd(b, a % b);
}
 
int main() {
	int t; cin >> t;
	while (t--) {
		int n; cin >> n;
		vector<ll> arr(n);
		for (int i = 0; i < n; i++) cin >> arr[i];
		
		ll sm = 0;
		for (int i = 0; i < n; i++) sm += arr[i];
		ll num = sm, cnt = n, dem = cnt;
		vector<ll> nums(n), dems(n);
		
		for (int i = 0; i < (n+1)/2; i++) {
			ll g = gcd(num, dem);
			nums[i] = nums[n-i-1] = num/g;
			dems[i] = dems[n-i-1] = dem/g;
			num += (sm -= arr[i] + arr[n-i-1]);
			dem += (cnt -= 2);
		}
 
		for (int i = 0; i < n; i++) {
			cout << nums[i] << "/" << dems[i] << " \n"[i==n-1];
		}
	}
}

