const ll M1 = 1'000'000'007, M2 = 1'000'000'009;
 
mt19937 rng((uint32_t)chrono::steady_clock::now().time_since_epoch().count());
ll B1 = uniform_int_distribution<ll>(11, M1)(rng);
ll B2 = uniform_int_distribution<ll>(11, M2)(rng);
 
void apply_hash(pi &x, int v) {
	x.f *= B1; x.f += v; x.f %= M1;
	x.s *= B2; x.s += v; x.s %= M2;
}
 
int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    
	int n, m; cin >> n >> m;
	vector<pi> hh(n, {0, 0});
	for (int i = 0; i < m; i++) {	
		int j; cin >> j;
		for (int k = 0; k < j; k++) {
			int x; cin >> x; x--;
			apply_hash(hh[x], i + 6969);
		}
	}
 
	vector<int> nx(n, -1);
	vector<bool> pr(n, false);
	map<pi, int> mp;
	for (int i = n-1; i >= 0; i--) {
		if (mp.count(hh[i])) {
			nx[i] = mp[hh[i]];
			pr[nx[i]] = true;
		}
		mp[hh[i]] = i;
	}
 
	int q; cin >> q;
	while (q--) {
		int k; cin >> k;
		set<int> st;
