#define FORN(i,a,b) for (int i = a; i < b; i++)
using ll = long long;
 
const int N = 200;
const ll MOD = 998244353;
ll modpow(ll x, ll p) {
	if (p == 0) return 1;
	ll v = modpow(x, p/2);
	return (v * v % MOD) * (p & 1 ? x : 1) % MOD;
}
 
ll pw[64][N][N];
 
int main() {
	int n, q; cin >> n >> q;
	int arr[n];
	FORN(i,0,n) cin >> arr[i];
 
	ll inv = modpow(n, MOD-2);
	FORN(i,0,N) FORN(j,0,N) pw[0][i][j] = 0;
	FORN(i,1,N) pw[0][i][i-1] = 1;
	for (int x : arr) pw[0][0][x-1] = inv;
 
	FORN(p,1,64) {
		FORN(i,0,N) {
			FORN(k,0,N) {
				FORN(j,0,N) {
					pw[p][i][j] += pw[p-1][i][k] * pw[p-1][k][j] % MOD;
				}
			}
			FORN(j,0,N) pw[p][i][j] %= MOD;
		}
	}
	
	while (q--) {
		ll l, r; cin >> l >> r; l--;
		
		vector<ll> pre(N, 0);
		pre[0] = 1;
		FORN(p,0,64) {
			if (l & (1LL << p)) {
				vector<ll> temp(N, 0);
				FORN(i,0,N) {
					FORN(j,0,N) {
						temp[i] += pw[p][i][j] * pre[j] % MOD;
					}
					temp[i] %= MOD;
				}
				swap(pre, temp);
			}
		}
 
		vector<ll> ans(N, 0);
		FORN(i,0,N) {
			for (int x : arr) {
				if (x-i-1 >= 0) {
					ans[i] += inv * pre[x-i-1] % MOD;
				}
			}
			ans[i] %= MOD;
		}
 
		ll sm = 0;
		FORN(i,0,N) sm += ans[i];
		sm %= MOD;
		assert(sm == 1);
 
		FORN(i,0,r-l) cout << (int)ans[i] << " ";
		cout << "\n";
	}
}

