const int N = 200;
using ll = __int128;
using vec = array<ll, N>;
using mat = array<array<ll, N>, N>;
 
const ll MOD = 998244353;
ll modpow(ll x, ll p) {
	if (p == 0) return 1;
	ll v = modpow(x, p/2);
	return (v * v % MOD) * (p & 1 ? x : 1) % MOD;
}
 
mat I, M;
mat pw[64];
mat mul(const mat a, const mat b) {
	mat c;
	FORN(i,0,N) FORN(j,0,N) c[i][j] = 0;
	FORN(i,0,N) FORN(k,0,N) FORN(j,0,N) c[i][j] += a[i][k] * b[k][j];
	FORN(i,0,N) FORN(j,0,N) c[i][j] %= MOD;
	return c;
}
vec matvec(const mat a, const vec b) {
	vec c;
	FORN(i,0,N) c[i] = 0;
	FORN(i,0,N) FORN(j,0,N) c[i] += a[i][j] * b[j];
	FORN(i,0,N) c[i] %= MOD;
	return c;
}
vec matpowvec(ll p, const vec b) {
	vec c;
	FORN(i,0,N) c[i] = b[i];
	FORN(i,0,64) {
		if (p & (1LL << i)) {
			c = matvec(pw[i], c);
		}
	}
	return c;
}
 
int main() {
	int n, q; cin >> n >> q;
	int arr[n];
	FORN(i,0,n) cin >> arr[i];
 
	FORN(i,0,N) FORN(j,0,N) I[i][j] = 0;
	FORN(i,0,N) I[i][i] = 1;
 
	FORN(i,0,N) FORN(j,0,N) M[i][j] = 0;
	FORN(i,1,N) M[i][i-1] = 1;
 
	ll inv = modpow(n, MOD-2);
	for (auto x : arr) M[0][x-1] = inv;
 
	pw[0] = M;
	FORN(i,1,64) pw[i] = mul(pw[i-1], pw[i-1]);
	
	vec f;
	FORN(i,0,N) f[i] = 0;
	f[0] = 1;
	
	while (q--) {
		long long l, r; cin >> l >> r;
		vec ret = matpowvec(l-1, f);
 
		vec ans;
		FORN(i,0,N) {
			ans[i] = 0;
			for (auto x : arr) {
				if (x-i-1 >= 0) {
					ans[i] += inv * ret[x-i-1];
				}
			}
			ans[i] %= MOD;
		}
 
		ll sm = 0;
		FORN(i,0,N) sm += ans[i];
		sm %= MOD;
		assert(sm == 1);
 
		FORN(i,0,r-l+1) cout << (int)ans[i] << " ";
		cout << "\n";
	}
}

