# Function to check if a word is skibidi
def is_skibidi(word):
    n = len(word)
    
    # We need at least 3 characters to make 3 syllables
    if n < 3:
        return False
    
    # Loop to place the first divider
    for i in range(1, n - 1):
        # Loop to place the second divider
        for j in range(i + 1, n):
            # Check if the three parts end with the same letter
            if word[i-1] == word[j-1] == word[-1]:
                return True
    
    return False

