    if is_skibidi(word):
        print("YES")
    else:
        print("NO")

def is_skibidi(word):
    n = len(word)
    last_letter = word[-1]
    
    # Scan from the front and find two positions that end with the same letter as the last one
    first_pos = -1
    second_pos = -1
    
    for i in range(n - 1):
        if word[i] == last_letter:
            if first_pos == -1:
                first_pos = i
            elif second_pos == -1:
                second_pos = i
            else:
                return True
    
    return False

