string simp(long long a, long long b) {
    for (int i = 2; i * i <= b; i++) {
        while (a % i == 0 && b % i == 0) {
            a /= i;
            b /= i;
        }
    }
    return to_string(a) + "/" + to_string(b);
}

void solve() {
    int n;
    long long s = 0, ss = 0, b = 0;
