def binarySearch(element, style="Exact"):
    l = 0
    r = binarySearchArrayLength()-1

    while l+1 < r:
        m = (l+r+randint(0,1))//2
        if binarySearchCompare(binarySearchArrayGet(m), element) <= 0:
            l = m
        if m != binarySearchArrayLength()-1 and binarySearchCompare(binarySearchArrayGet(m+1), element) > 0:
            r = m+1
    
    if style in ["Exact","exact","E","e",0.5]:
        if binarySearchCompare(binarySearchArrayGet(l), element) == 0: return l
        if binarySearchCompare(binarySearchArrayGet(r), element) == 0: return r

        return -1
    
    if style in ["Floor","floor","F","f",0]:
        if binarySearchCompare(binarySearchArrayGet(l), element) > 0: return -1
        if binarySearchCompare(binarySearchArrayGet(r), element) > 0: return l
        
        return r
        
    if style in ["Ceiling","ceiling","Ceil","ceil","C","c",1]:        
        if binarySearchCompare(binarySearchArrayGet(r), element) < 0: return -1
        if binarySearchCompare(binarySearchArrayGet(l), element) < 0: return r

        return l
    
    raise Exception("Binary search style invalid!")

