struct DSU {
	vector<int> p, c;
	int cc;
 
	DSU(int n) : c(n, -1), p(n){
		cc = n;
		for(int i = 0; i < n; i++) {
			p[i] = i;
		}
	}
 
	int get(int i) {
		if(p[i] == i) return i;
		return p[i] = get(p[i]);
	}
 
	int size(int i) {
		return c[get(i)];
	}
 
	bool same(int x, int y) {
		return get(x) == get(y);
	}
 
	bool unite(int x, int y) {
		x = get(x);
		y = get(y);
		if(x == y) return false;
		cc--;
		if(c[x] > c[y]) swap(x, y);
		p[x] = y;
		c[y] += c[x];
		return 1;
	}
};

