struct DSU {
    vector<int> p, c;

    DSU(int n) : c(n, 1), p(n) { for (int i = 0; i < n; ++i) p[i] = i; }

    int get(int v) {
        if (p[v] == v) return v;
        return p[v] = get(p[v]);
    }

