mobiusList = []
def mobius(n):
    global mobiusList

    if n < len(mobiusList): return mobiusList[n]
    prime = [1] * (n + 1)
    mobiusList = [1] * (n + 1)

    for i in range(2, n + 1):
        if not prime[i]:
            continue
        mobiusList[i] = -1
        for j in range(2, n // i + 1):
            prime[i * j] = 0
            mobiusList[i * j] *= -1
        for j in range(1, n // (i * i) + 1):
            mobiusList[j * i * i] = 0
    return mobiusList

