            SPF[i] = i

        j = 0
        while (j < len(prime) and
               i * prime[j] < N and
                   prime[j] <= SPF[i]):

            isprime[i * prime[j]] = False
            SPF[i * prime[j]] = prime[j]
            j += 1
    
