def getPrimes(N):
    global prime
    global primeset

    isprime = [True for i in range(N+1)]
    isprime[0] = isprime[1] = False
    SPF = [None] * (N)

    for i in range(2, N):
        if isprime[i]:
            prime.append(i)
            SPF[i] = i

        j = 0
        while (j < len(prime) and
               i * prime[j] < N and
                   prime[j] <= SPF[i]):

            isprime[i * prime[j]] = False
            SPF[i * prime[j]] = prime[j]
            j += 1
    
    primeset = set(prime)

def getRidOf(n,p):
    while n % p == 0: n = n//p
    return n

def factors(n):
    ans = dict()
    if len(prime) < math.ceil(math.sqrt(n))+3:
        getPrimes(math.ceil(math.sqrt(n))+5)
    for i in prime:
        if i > math.ceil(math.sqrt(n))+3: break
        while n % i == 0:
            if i in ans: ans[i] += 1
            else: ans[i] = 1
            n = n // i
    if n > 1:
        if n in ans: ans[n] += 1
        else: ans[n] = 1
    
    return ans

def totient(n):
    totient = n
    for factor in factors(n):
        totient -= totient // factor
    return totient

