def squarefree(n):
    if n % 2 == 0:
        n = n / 2
    if n % 2 == 0:
        return False

    for i in range(3, int(sqrt(n) + 1)):
        if n % i == 0:
            n = n / i
        if n % i == 0:
            return False
    return True

# https://smsxgz.github.io/post/pe/counting_square_free_numbers/
mobiusList = []
def mobius(n):
    global mobiusList

    if n < len(mobiusList): return mobiusList[n]
    prime = [1] * (n + 1)
    mobiusList = [1] * (n + 1)

    for i in range(2, n + 1):
        if not prime[i]:
            continue
        mobiusList[i] = -1
        for j in range(2, n // i + 1):
            prime[i * j] = 0
            mobiusList[i * j] *= -1
        for j in range(1, n // (i * i) + 1):
            mobiusList[j * i * i] = 0
    return mobiusList

# https://smsxgz.github.io/post/pe/counting_square_free_numbers/
def count_squarefree(N):
    global mobius

    Imax = int(pow(N//4,1/3))
    D = int(sqrt(N / Imax))
    mobius(D)

    # compute S1
    s1 = 0
    for i in range(1, D + 1):
        s1 += mobiusList[i] * (N // (i * i))

    # compute M(d), d = 1, ..., D
    M_list = [0]
    M = 0
    for m in mobiusList[1:]:
        M += m
        M_list.append(M)

    # compute M(sqrt(n / i)), i = Imax - 1, ..., 1
    Mxi_list = []
    Mxi_sum = 0
    for i in range(Imax - 1, 0, -1):
        Mxi = 1
        xi = int(sqrt(N // i))

        sqd = int(sqrt(xi))
        # sqd < D <= xi
        for j in range(1, xi // (sqd + 1) + 1):
            Mxi -= (xi // j - xi // (j + 1)) * M_list[j]

        for j in range(2, sqd + 1):
            if xi // j <= D:
                Mxi -= M_list[xi // j]
            else:
                Mxi -= Mxi_list[Imax - j * j * i - 1]

        Mxi_list.append(Mxi)
        Mxi_sum += Mxi

    # compute S2
    s2 = Mxi_sum - (Imax - 1) * M_list[-1]
    return s1 + s2

