template<typename T> 
struct BIT {
	V<T> s;
	BIT(int n) : s(n) {}
	void update(int pos, T dif) {
		for (; pos < sz(s); pos |= pos + 1) s[pos] += dif;
	}
	T query(int pos) {
		T res = 0;
		for (; pos > 0; pos &= pos - 1) res += s[pos-1];
		return res;
	}
	T lower_bound(T sum) {
		if (sum <= 0) return -1;
		T pos = 0;
		for (T pw = 1 << 25; pw; pw >>= 1) {
			if (pos + pw <= sz(s) && s[pos + pw-1] < sum)
				pos += pw, sum -= s[pos-1];
		}
		return pos;
	}
};
