def getPrimes(N):
    global prime
    global primeset

    isprime = [True for i in range(N+1)]
    isprime[0] = isprime[1] = False
    SPF = [None] * (N)

    for i in range(2, N):
        if isprime[i]:
            prime.append(i)
            SPF[i] = i

        j = 0
        while (j < len(prime) and
               i * prime[j] < N and
                   prime[j] <= SPF[i]):

            isprime[i * prime[j]] = False
            SPF[i * prime[j]] = prime[j]
            j += 1
    
    primeset = set(prime)

def getRidOf(n,p):
