    return n

def factors(n):
    ans = dict()
    if len(prime) < math.ceil(math.sqrt(n))+3:
        getPrimes(math.ceil(math.sqrt(n))+5)
    for i in prime:
        if i > math.ceil(math.sqrt(n))+3: break
        while n % i == 0:
            if i in ans: ans[i] += 1
            else: ans[i] = 1
            n = n // i
    if n > 1:
        if n in ans: ans[n] += 1
        else: ans[n] = 1
    
