def heuristic(n, step, jump):
    if n == 1:
        return 0
    
    thing = [0] * n
    thing[1] = step[0]  
    for i in range(2, n):
        thing[i] = thing[i-1] + step[i-1]
        if i > 1:
            thing[i] = min(thing[i], thing[i-2] + jump[i-2])
    return thing[-1]

