# https://en.wikipedia.org/wiki/Fast_Walsh%E2%80%93Hadamard_transform
def fwht(a) -> None:
    """In-place Fast Walsh–Hadamard Transform of array a."""
    h = 1
    while h < len(a):
        # perform FWHT
        for i in range(0, len(a), h * 2):
            for j in range(i, i + h):
                x = a[j]
                y = a[j + h]
                a[j] = x + y
                a[j + h] = x - y
        # normalize and increment
        h *= 2

def xorConvolution(c,d):
    # assuming a and b already have the same number of elements that is a power of 2
    a = c.copy()
    b = d.copy()
    fwht(a)
    fwht(b)
    
    hi = []
    for i in range(len(a)):
        hi.append(a[i]*b[i])
    fwht(hi)
    for j in range(len(hi)):
        hi[j] //= len(a)
    return hi

