    private static int minCalories(int n, int[] step, int[] jump) {
        int[] dp = new int[n];
        dp[0] = 0; 

        for (int i = 1; i < n; i++) {
            dp[i] = dp[i - 1] + step[i - 1];

            if (i >= 2) {
                dp[i] = Math.min(dp[i], dp[i - 2] + jump[i - 2]);
            }
        }

        return dp[n - 1];
    }
}

