template<typename T> 
struct DSU {
        int cc; 
	V<T> e; 
	DSU(T N) : e(N, -1) {
	  cc = N;
	}
	T get(T x) { return e[x] < 0 ? x : e[x] = get(e[x]); } 
	bool sameSet(int a, int b) { return get(a) == get(b); }
	T size(int x) { return -e[get(x)]; }
        bool unite(T x, T y) {
		x = get(x), y = get(y); if (x == y) return 0;
		cc--;
		if (e[x] > e[y]) swap(x,y);
		e[x] += e[y]; e[y] = x; return 1;
	}
};
