        for(auto &x: a) cin >> x;
        
        vector<ll> prefix_sum(n +1, 0);
        vector<ll> prefix_weighted_sum(n +1, 0);
        for(int i=1;i<=n;i++){
            prefix_sum[i] = prefix_sum[i-1] + a[i-1];
            prefix_weighted_sum[i] = prefix_weighted_sum[i-1] + (ll)i * a[i-1];
        }
        
        vector<ll> reversed_a(n, 0);
        for(int i=0;i<n;i++) reversed_a[i] = a[n - i - 1];
        
        vector<ll> prefix_sum_reversed(n + 1, 0);
        vector<ll> prefix_weighted_sum_reversed(n + 1, 0);
        for(int i=1;i<=n;i++){
            prefix_sum_reversed[i] = prefix_sum_reversed[i-1] + reversed_a[i-1];
            prefix_weighted_sum_reversed[i] = prefix_weighted_sum_reversed[i-1] + (ll)i * reversed_a[i-1];
        }

        vector<string> results;
        for(int k=1;k<=n;k++){
            ll S1 = prefix_weighted_sum[k];
            ll S2 = (k <= n -k +1) ? (prefix_sum[n - k + 1] - prefix_sum[k]) : (prefix_sum[n - k + 1] - prefix_sum[k]);
            ll S3 = (k-1 >=0) ? prefix_weighted_sum_reversed[k-1] : 0;
            ll sum_cja_j = S1 + (ll)k * S2 + S3;
            
            ll denominator = (ll)k * (n -k +1);
            
            ll g = gcd_func(sum_cja_j, denominator);
            ll p = sum_cja_j / g;
            ll q = denominator / g;
            
            results.emplace_back(to_string(p) + "/" + to_string(q));
        }
        
        for(int i=0;i<results.size();i++){
            if(i >0) cout << ' ';
            cout << results[i];
        }
        cout << '\n';
    }
}

