vector<int> generatePascal(vector<int> prev, int pL) {
	vector<int> arr(pL+1);
	
	for (int i = 0; i < pL+1; i++) {
		if (i == 0 || i == pL) arr[i] = 1;
		else arr[i] = prev[i-1] + prev[i];
	}
	
	return arr;
	
}

